import React, { Component } from 'react';

class PokemonListData extends Component{

  constructor(props) {
    super(props);
    this.state = {
      error: null,
      items: []
    };
  }

    componentDidMount() {
        fetch('https://pokeapi.co/api/v2/pokemon/ditto')
        .then(res => res.json())
        .then((result) => {
          this.setState({ items: result })
          console.log(result);
        })
        .catch(console.log)
      }
}

export default PokemonListData;
